import React from 'react';
import { Line } from 'react-chartjs-2';

const PriceHistoryChart = ({ data }) => {
    // Extract values for height, price, and amount from each listing
    const heights = data.map((item) => item.height);
    const prices = data.map((item) => item.data.list.price);
    const amounts = data.map((item) => {
        // Check if 'origin' and 'insc' properties exist before accessing 'amt'
        if (item.origin && item.origin.data && item.origin.data.insc) {
            return parseFloat(item.origin.data.insc.json.amt);
        } else {
            return 0; // Use 0 if 'amt' is not available
        }
    });

    const chartData = {
        labels: heights, // X-axis labels (block height)
        datasets: [
            {
                label: 'Price History',
                data: amounts.map((amt, index) => amt / prices[index]), // Y-axis data (amount/price)
                fill: false,
                borderColor: 'blue',
            },
        ],
    };

    const options = {
        scales: {
            x: {
                type: 'linear',
                position: 'bottom',
            },
        },
    };

    return (
        <div>
            <h2>Price History Chart</h2>
            <Line data={chartData} options={options} />
        </div>
    );
};

export default PriceHistoryChart;
